import React from "react";
import { Form } from "react-bootstrap";
import '../assets/css/styles.css'

const AuthInput = (props) => {
  let { registrado } = props;
  let {change} = props;

  if (registrado===false) {
    return (<Form.Group className="forma-input" >
            <Form.Label className="forma-label">Contrase√±a</Form.Label>
            <Form.Control type="rut" onChange={change}/>
        </Form.Group>);
  }
  else {
      return null
  } 
};

export default AuthInput;
